import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Form from './components/Form';
import axios from 'axios';

// Function to fetch data from the backend API
const fetchData = async () => {
  try {
    const response = await axios.get('/api/beneficiary_info'); // Adjust the URL if needed
    console.log(response.data); // This will log the data to the console
  } catch (error) {
    console.error(error);
  }
};
function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/intake" element={<Form />} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
        backgroundColor: '#ffffcc',
      }}
    >
      <button
        style={{
          backgroundColor: 'cornflowerblue',
          color: 'white',
          padding: '20px 40px',
          fontSize: '20px',
          border: 'none',
          borderRadius: '4px',
          cursor: 'pointer',
        }}
      >
        <Link to="/intake">Start</Link>
      </button>
    </div>
  );
}

export default App;
